import './InfoReposts.css'

export default function InfoReposts({posts}) {

    return (
        <tr className='info'>
            {posts.user_name.map(item =>(
            <td key={item.id} className='infopostdate'>{item.user_name}</td>))

            }
            <td className='infopostdate'>{posts.user_name}</td>
            <td className='infotablestart'>{posts.workstart}</td>
            <td className='infotableend'>{posts.workend}</td>
            <td className='RepostsLong'>{posts.worklong}</td>
        </tr>
    )
}
